import React from "react";


//var
//let
//const


const canvas = (props) => {
  let style = {
    //backgroundColor: `${props.color}`,
    position:"absolute",
    top:`${props.top}px`,
    left:`${props.left}px`,

    width: '100px',
    height: '100px'
  };
  console.log(style)
  return <div style={style}></div>
  //return <div></div>
}

export default canvas;
